import { useState, useEffect } from "react";

function fetchData() {

    const [data, setData] = useState([]);

    useEffect(() => {

        fetch('https://www.colourlovers.com/api/colors/new?format=json')
            .then((res) => res.json())
            .then((json) => { setData(json); })
            .catch((error) => console.log(error));
    
    }, []);

    return (
        <div className="">

        </div>
    );
}

export default fetchData;
